import React from "react";
import Entry from "./Entry";
import Emojis from "../emojipedia";

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">
        <Entry emoji={Emojis[0].emoji} name={Emojis[0].name} meaning={Emojis[0].meaning} />
        <Entry emoji={Emojis[1].emoji} name={Emojis[1].name} meaning={Emojis[1].meaning} />
        <Entry emoji={Emojis[2].emoji} name={Emojis[2].name} meaning={Emojis[2].meaning} />
      </dl>
    </div>
  );
}

export default App;
